        "too_many_results_desc": "Počet stránek na stránce nesmí překročit 10 000.\nZkuste použít filtry ke snížení počtu výsledků, nebo označte\npozorování jako zkontrolovaná a použijte tlačítko \"Zobrazit více\" místo\nstránkování\n",
