        "too_many_results_desc": "Side antal gange antallet af resultater per side må ikke overstige 10.000.\nPrøv at bruge filtre for at reducere antallet af resultater, eller markér observationer som gennemgået og brug \"Se mere\" knappen i stedet for sideinddeling\n",
