  "cc_by_description": "רישיון זה מאפשר לאחרים להפיץ, ליצור מחדש, לכוונן ולבנות את עבודתך, אפילו למטרות מסחריות, אך ורק תוך מתן קרדיט לך על היצירה המקורית.",
  "cc_by_name": "ייחוס",
  "cc_by_nc_description": "רישיון זה מאפשר לאחרים ליצור מחדש, לכוונן ולבנות את עבודתך למטרות שאינן מסחריות. עם זאת, למרות שהעבודה החדשה שלהם חייבת לתת לך קרדיט ולהיות לא־מסחרית, הם לא חייבים להפיץ את עבודתם החדשה תחת אותם התנאים של עבודתך.",
  "cc_by_nc_name": "ייחוס–לא מסחרי",
  "cc_by_nc_nd_description": "רישיון זה הוא המגביל ביותר מבין ששת הרישיונות הנפוצים. הוא מאפשר לאחרים להוריד את עבודתך ולשתף אותה עם אחרים בתנאי שהם נותנים לך קרדיט, אבל הם לא יכולים לשנות את העבודה בשום צורה או להשתמש בה למטרות מסחריות.",
  "cc_by_nc_nd_name": "ייחוס–לא מסחרי–NoDerivs",
  "cc_by_nc_sa_description": "רישיון זה מאפשר לאחרים ליצור מחדש, לכוונן ולבנות את עבודתך למטרות שאינן מסחריות, אך ורק תוך מתן קרדיט לך ורישוי היצירות החדשות תחת אותם התנאים של עבודתך.",
  "cc_by_nc_sa_name": "ייחוס–לא מסחרי–ShareAlike",
  "cc_by_nd_description": "רישיון זה מאפשר להפיץ מחדש את עבודתך, הן למטרות מסחריות והן למטרות שאינן מסחריות, אך ורק אם העבודה מועברת בשלמותה ללא שום שינויים, ותוך מתן קרדיט לך.",
  "cc_by_nd_name": "ייחוס–NoDerivs",
  "cc_by_sa_description": "רישיון זה מאפשר לאחרים ליצור מחדש, לכוונן ולבנות את עבודתך אפילו למטרות מסחריות, אך ורק תוך מתן קרדיט לך ורישוי היצירות החדשות תחת אותם התנאים של עבודתך. כל העבודות החדשות שמבוססות על עבודתך תהיינה עם אותו הרישיון, ולכן כל עבודה חדשה תאפשר גם שימוש מסחרי.",
  "cc_by_sa_name": "ייחוס–ShareAlike",
