        "total_taxa_desc": "Questo è il numero totale di taxa \"foglia\" risultanti dall'interrogazione.\nA volte vedrai più righe con conteggi diversi da zero perché ci sono taxa di livello superiore provenienti da altre interrogazioni. Per esempio, Se l'Interrogazione 1 ha un'osservazione di Homo sapiens e l'Interrogazione 2 ha un'osservazione di Genere Homo, entrambi i taxa saranno presenti nella tabella, ma nell'Interrogazione 1 il Genere Homo costituisce una riga aggiuntiva ma non è incluso nel conteggio totale perchè l'interrogazione ha considerato solo la specie Homo sapiens all'interno di quel genere (in quanto quella costituiva la \"foglia\" di quella parte dell'albero).\n",
