  "cc_0_description": "Denne lisensen frigir verket ditt, så andre kan kopiere, endre, distribuere og fremføre verket, selv for kommersielle formål, uten å spørre om tillatelse eller å navngi deg. Dette er en mest åpne lisensen som tilbys. Anbefalt for maksimal spredning og bruk av lisensierte materialer.",
  "cc_0_name": "Ingen opphavsrett (CC0)",
  "cc_by_description": "Denne lisensen lar andre distribuere, endre, remixe, og bygge videre på ditt verk, også for kommersielle formål, så lenge de navngir deg som den opprinnelige opphavspersonen.",
  "cc_by_name": "Navngivelse",
  "cc_by_nc_description": "Denne lisensen lar andre distribuere, endre, remixe, og bygge videre på ditt verk for ikke-kommersielle formål. Deres verk må navngi deg som opphavsperson og også være ikke-kommersielle, men de behøver ikke kreve at verk avledet fra deres bærer de samme vilkårene.",
  "cc_by_nc_name": "Navngivelse-IkkeKommersiell",
  "cc_by_nc_nd_description": "Denne lisensen er den mest restriktive av de seks kjernelisensene. Den tillater andre å laste ned ditt verk og dele dem med andre så lenge du er navngitt som opphavspersonen, men de kan ikke endre dem på noen måte, eller bruke dem kommersielt.",
  "cc_by_nc_nd_name": "Navngivelse-IkkeKommersiell-IngenBearbeidelser",
  "cc_by_nc_sa_description": "Denne lisensen lar andre distribuere, endre, remixe, og bygge videre på ditt verk for ikke-kommersielle formål. Deres verk må navngi deg som den opprinnelige opphavspersonen og avledete verk må bære en tilsvarende lisens.",
  "cc_by_nc_sa_name": "Navngivelse-IkkeKommersiell-DelPåSammeVilkår",
  "cc_by_nd_description": "Denne lisensen tillater andre å redistribuere verket ditt, kommersielt og ikke-kommersielt, så lenge de sprer det uendret og i sin helhet, og navngir deg.",
  "cc_by_nd_name": "Navngivelse-IngenBearbeidelse",
  "cc_by_sa_description": "Denne lisensen lar andre distribuere, endre, remixe, og bygge videre på ditt verk, også for kommersielle formål, så lenge de navngir deg som den opprinnelige opphavspersonen og avledete verk må bære en tilsvarende lisens. Alle nye verk basert på ditt vil være utstyrt ned den samme lisensen, slik at eventuelle avledete verk vil også tillate kommersiell bruk.",
