        "max_photos_desc": "Een taxon kan slechts %{max} foto's bevatten. Je moet bestaande foto's verwijderen om anderen toe te kunnen voegen.\n",
        "photo_chooser_modal_desc": "Sleep hier foto's naartoe vanaf de linkerkant of versleep ze hier om ze te herschikken.\n",
        "photo_chooser_modal_explanation": "Merk op dat de taxon-pagina foto's van dit taxon zal tonen\nen zijn nakomelingen. De foto's die hiervoor zijn gekozen\nvan dit taxon zal het worden getoond. De eerste foto zal de\nde standaardafbeelding zijn die op de site wordt gebruikt.\n",
