  "categories": "Kategoritë",
  "cc_0_description": "Kjo licencë lëshon punën tuaj në domenin publik, kështu që të tjerët mund ta kopjojnë, modifikojnë, shpërndajnë dhe kryejnë punën tuaj, madje edhe për qëllime komerciale, të gjitha pa ju kërkuar leje ose pa ju dhënë kredit. Kjo është më e pranueshmja e licencave të ofruara. Rekomandohet për shpërndarjen maksimale dhe përdorimin e materialeve të licencuara.",
  "cc_0_name": "Asnjë drejtë e rezervuar (CC0)",
  "cc_by_description": "Kjo licencë lejon të tjerët të shpërndajnë, remixojnë, ndryshojnë, dhe të ndërtojnë mbi punën tuaj, qoftë edhe komercialisht, për aq kohë sa t'u japin merita për krijimin origjinal.",
  "cc_by_name": "Atributim",
  "cc_by_nc_description": "Kjo licencë lejon të tjerët të remixojnë, përpunojnë dhe të ndërtojnë mbi punën tuaj jo-komercialisht, dhe megjithëse punimet e tyre të reja duhet t'ju njohin dhe të jenë jo-komerciale, ata nuk duhet të licencojnë veprat e tyre të derivuara sipas kushteve të njëjta.",
  "cc_by_nc_name": "Atributim-JoKomercial",
  "cc_by_nc_nd_description": "Kjo licencë është më kufizuesja nga gjashtë licencat kryesore, vetëm duke u lejuar të tjerëve të shkarkojnë punimet tuaja dhe t'i ndajnë me të tjerët për sa kohë që ju japin merita, por ato nuk mund t'i ndryshojnë ato në asnjë mënyrë ose t'i përdorin ato komercialisht.",
  "cc_by_nc_nd_name": "Atributimi-JoKomerciale-JoDerivative",
  "cc_by_nc_sa_description": "Kjo licencë lejon të tjerët të remixojnë, përpunojnë dhe të ndërtojnë mbi punën tuaj jo-komercialisht, për aq sa ata ju dhënë merita ju dhe licencojnë krijimet e tyre të reja nën kushte identike.",
