  "cc_by_nd_description": "Kjo licencë lejon rishpërndarjen, komerciale e jo komerciale, për aq kohë sa ajo kalon e pandryshuar dhe e plote, me merita për ju.",
  "cc_by_nd_name": "Atributimi-PaDerivacione",
  "cc_by_sa_description": "Kjo licencë lejon të tjerët të kombinojnë, të nxjerrin dhe të plotësojnë punën tuaj, qoftë edhe për qëllime komerciale, përderisa jua veshin/atribuojnë juve dhe licencojnë krijimet e tyre të reja në pajtim me të njëjtat kushte identike. Të gjitha punimet e reja të bazuara mbi tuajat do të mbajnë të njëjtën licencë, dhe çdo gjë që rrjedh prej tyre po ashtu do të lejojë përdorimin komercial.",
