        "inaturalist_network_desc": "Kolla in Året som gått för medlemmarna i iNaturalist-nätverket.\n",
        "include_usa": "Inkludera USA",
        "new_species_desc_html": "Arter som lades till för första gången i år.\nKlicka på en månad för att se några av de nya arter som lagts till den månaden.\nDu kan också se det sammanlagda totala antalet, eller flytta reglaget\nbakåt i tiden för att se andra nya observerade arter. Detta diagram visar\narter från verifierbara observationer från månaden de laddades upp\ntill %{site_name} (inte den månad de observerades). Det innehåller inte\ntaxa på högre eller lägre nivå, så en observation som bestämts till\nMammalia räknas inte, och en observation av <i>Canis lupus arctos</i>\nräknas bara som <i>Canis lupus</i>.\n",
        "obs_in_year": "Obs i %{year}",
        "observation_streaks": "Observationsräcka",
        "observation_streaks_color_desc": "Färgen motsvarar antalet dagar på en logaritmisk skala:\n",
        "observation_streaks_desc": "En observationsräcka är en tidsperiod under vilken någon gick ut och\ngjorde nya, verifierbara observationer varje dag. Här visas de längsta\nräckorna som påbörjades i år eller redan pågick när denna statistik\nskapades.\n",
        "percent_growth_in_year": "% tillväxt i %{year}",
        "percent_of_total_growth": "% av total tillväxt",
        "publications_desc_short_html": "Klicka på blomdiagrammen för mer information om vad siffrorna\noch färgerna betyder. Påverkansdata och -diagram tack vare\n<a href=\"https://www.altmetric.com\">Altmetric</a>. Information\nom dataanvändning tack vare våra vänner på\n<a href=\"https://www.gbif.org/\">Global Biodiversity Information Facility</a>.\n",
        "stats_generated_datetime": "Statistik skapad den %{datetime}",
        "store_prompt": "Vill du visa din stolthet över iNat vart du än är? Kolla in iNat-butiken!\n",
        "sunburst_desc_html": "Observerade taxa ordnade i ett hierarkiskt soldiagram. Hierarkins\nbas är i centrum, där den börjar med \"Liv\" för att sluta med arter i\nytterkanterna. Storleken på varje båge är proportionell mot antalet\nobservationer av detta taxon, och färgerna motsvarar ungefär de\nvanliga \"klassiska\" taxonfärgerna (grönt för växter,\norange för insekter, blått för de flesta andra djur etc.), så om du\nser en hel del grönt, betyder det att du observerat en hel del växter.\n<strong>Klicka på en båge för att placera detta taxon i mitten</strong>\noch dess barn runt det, eller <strong>klicka på mitten för att gå upp i\nhierarkin igen</strong>.\n",
        "translators_desc": "Visste du att iNaturalist har översatts till %{x_languages},\nnästan uteslutande av %{x_people}, av vilka några inte ens använder iNat? Här\när alla fantastiska översättare som har lagt till översättningar i år,\ntillsammans med antalet ord de har översatt för\n%{website_link_tag}webbplatsen%{link_tag_end}, vår\n%{iphone_link_tag}iPhone%{link_tag_end} och\n%{android_link_tag}Android%{link_tag_end} appar och\n%{seek_link_tag}Seek%{link_tag_end}. Du kan se\nalla personer som har bidragit med översättningar,\ninklusive personer från tidigare år och folk från Translatewiki, på vår\n%{view_all_web_link_tag}webbs%{link_tag_end} och vår\n%{view_all_mobile_link_tag}mobila%{link_tag_end} datakatalog.\n",
        "translators_desc_for_site": "Visste du att %{site_name} har översatts nästan uteslutande av\n%{x_people}? Här är alla fantastiska översättare som\nhar lagt till översättningar i år, tillsammans med antalet ord\nde har översatt för\n%{website_link_tag}webbplatsen%{link_tag_end}, iNaturalist\n%{iphone_link_tag}iPhone%{link_tag_end} och\n%{android_link_tag}Android%{link_tag_end} appar och\n%{seek_link_tag}Seek%{link_tag_end}. Du kan se\nalla personer som har bidragit med översättningar på alla språk,\ninklusive personer från tidigare år och folk från Translatewiki, i vår\n%{view_all_web_link_tag}webbs%{link_tag_end} och vår\n%{view_all_mobile_link_tag}mobila%{link_tag_end} datakatalog.\n",
