        "new_species_desc_html": "此年度首次添加的物種。\n在月份上點擊來檢視添加在該月份的新物種。\n您也可以檢視物種累積的總數目，或是在時段裡移動滑桿返回來查看其它新進的觀察物種。此圖表顯示依照物種被上傳至 %{site_name} 的月份（不是牠們被觀察到的月份）之可驗證觀察來顯示出。這不會包含到較高或較低層級的物種分類，因此當一個觀察被鑑定為是哺乳類便不會被計入，所以屬於 <i>Canis lupus</i> ssp.\n<i>arctos</i> 的觀察只會被計在 <i>Canis lupus</i> 裡。\n",
